import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field to be available
    await page.waitForSelector('#eventSearchInput');

    // Type 'nonexistent' into the search input
    await page.fill('#eventSearchInput', 'nonexistent');

    // Wait for the search button to be available and click it
    await page.waitForSelector('button.search-btn');
    await page.click('button.search-btn');

    // Wait for the results to load (or for an indication that no results were found)
    await page.waitForTimeout(1000); // Adjust timeout as necessary

    // Take a screenshot after the search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Extract meaningful data to verify task completion
    const noResultsMessage = await page.locator('text=No results found').isVisible();

    return {
      success: true,
      action: "Searched for 'nonexistent' and verified no results were found",
      extractedData: { noResultsMessage },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

